B.Au=new A.Ix("Sistem Pendukung Keputusan Untuk Penerimaan Bantuan Sosial Di RW 15 Kel. Pancoran Mas Kota Depok","Maret 2024 - Agustus 2024","Projek ini merupakan projek skripsi sebagai salah satu syarat untuk meraih gelar sarjana.  Sistem informasi ini dirancang untuk membantu pengambilan keputusan dalam pemberian bantuan sosial di RW 15 menggunakan metode TOPSIS (Technique for Order Preference by Similarity to Ideal Solution), metode ini dapat mengambil keputusan multikriteria dengan ide dasarnya alternatif yang dipilih memiliki jarak terdekat dengan solusi ideal positif dan memiliki jarak terjauh dari solusi ideal negatif. Aplikasi ini dikembangkan menggunakan bahasa pemrograman Java dengan IDE NetBeans, yang terintegrasi dengan database MySQL melalui XAMPP.","Skripsi Kampus","https://www.youtube.com/watch?v=cY6tAaKYxCk",B.DH)
